<script setup lang="ts">
const props = defineProps<{ mousePos: number[] }>()
const svg = ref<SVGElement>()
const keyframes = [
  { transform: 'scale(0.8)', opacity: 0 },
  { transform: 'scale(1.04)', opacity: 1 },
  { transform: 'scale(1)', opacity: 1 },
]
const { playState } = useAnimate(svg, keyframes, { duration: 400, persist: true })

watch([() => props.mousePos, playState], ([[x, y], state]) => {
  if (state !== 'finished') return;

  svg.value?.classList.remove('opacity-0')

  const coinSm = svg.value?.querySelector('#coin-sm')
  const coinLg = svg.value?.querySelector('#coin-lg')
  const chart = svg.value?.querySelector('#chart')
  const globe = svg.value?.querySelector('#globe')
  const coins = svg.value?.querySelector('#coins')
  const bills = svg.value?.querySelector('#bills')

  coinSm?.setAttribute('transform', `translate(${x / 40}, ${y / 20})`)
  coinLg?.setAttribute('transform', `translate(${x / 30}, ${y / 20})`)
  chart?.setAttribute('transform', `translate(${x / 100}, ${y / 100})`)
  globe?.setAttribute('transform', `translate(${x / 80}, ${y / 50})`)
  coins?.setAttribute('transform', `translate(${x / 40}, ${y / 50})`)
  bills?.setAttribute('transform', `translate(${x / 80}, ${y / 80})`)
})
</script>
